import * as React from 'react';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import {lightBlue} from '@mui/material/colors';
import { useState } from "react";



export default function AddMovie() {
    
    const [movieTitle, setMovieTitle] = useState("");
    const [producer, setProducer] = useState("");
    const [director, setDirector] = useState("");
    const [cast, setCast] = useState("");
    const [rating, setRating] = useState("");
    const [description, setDescription] = useState("");
    const [picture, setPicture] = useState("");



    function handleSubmit(e) {
        e.preventDefault();
        window.location.assign("http://localhost:3000/manage");
        alert("Movie Added");
        
    }

    const onChangePicture = e => {
        console.log('picture: ', picture);
        setPicture(e.target.files[0]);
    };

    const VisuallyHiddenInput = styled('input')({
        clip: 'rect(0 0 0 0)',
        clipPath: 'inset(50%)',
        height: 1,
        overflow: 'hidden',
        position: 'absolute',
        bottom: 0,
        left: 0,
        whiteSpace: 'nowrap',
        width: 1,
      });

    return (
        
        <body className= "reg"> 
            <h1>Add Movie</h1>
            <form onSubmit={handleSubmit}>
                <div className="input-group">
                <label htmlFor="movieTitle">Movie Title</label>
                <input type="text" onChange={event => {setMovieTitle(event.target.value)}}/>
                </div>

                <div className="input-group">
                <label htmlFor="producer">Producer</label>
                <input type="text" onChange={event => {setProducer(event.target.value)}} />
                </div>

                <div className="input-group">
                <label htmlFor="director">Director</label>
                <input type="text" onChange={event => {setDirector(event.target.value)}} />
                </div>

                <div className="input-group">
                <label htmlFor="cast">Cast</label>
                <input type="text" onChange={event => {setCast(event.target.value)}} />
                </div>

                <div> 
                    Rating
                    <select onChange={event => {setRating(event.target.value)}}>
                        <option value="G">G</option>
                        <option value="PG-13">PG-13</option>
                        <option value="R">R</option>
                        <option value="Adult">18+</option>
                    </select>
                </div>

                <div className="input-group">
                <label htmlFor="description">Description</label>
                <textarea
                row={5} 
                cols={5} 
                onChange={event => {setDescription(event.target.value)}}/>
                </div>

                <div>
                <FormGroup>
                    <FormControlLabel control={<Checkbox sx={{color: lightBlue[800],'&.Mui-checked': {color: lightBlue[600],},}}/>} label="Currenty Showing"  />
                </FormGroup>
                </div>

                <div>
                <Button component="label" variant="contained" startIcon={<CloudUploadIcon />}>
                    Upload file
                    <VisuallyHiddenInput type="file" onChange={onChangePicture}/>
                </Button>
                </div>


                <button type="submit" className="submit-btn">
                Submit
                </button>
            </form>
            
            
        </body>
        
        
    )
}
